// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract TenancyDeposit is ReentrancyGuard {

  address public landlord;
  address public tenant;
  address public adjudicator;

  uint public propertyId;
  uint public depositRequired;
  uint public depositPaid;
  uint public amountToRefund;

  bool public isAgreementActive;

  event LogDepositPaid(address indexed tenant, uint depositAmount, uint propertyId, bool agreementState);
  event LogDepositReturn(address indexed landlord, address indexed tenant, uint returnedAmount, uint propertyId, bool agreementState);

  modifier tenantOnly() {
    require(msg.sender == tenant, "Action can only be performed by a tenant");
    _;
  }

  modifier landlordOnly() {
    require(msg.sender == landlord, "Action can only be performed by a landlord");
    _;
  }

  modifier adjudicatorOnly() {
    require(msg.sender == adjudicator, "Action can only be performed by an adjudicator");
    _;
  }

   modifier paidCorrectDeposit() { 
    require(msg.value == depositRequired, "Please pay the exact deposit required"); 
    _;
  }

  modifier enoughDepositBalance() {
    require(address(this).balance >= depositRequired, "Contract balance is less than deposit amount"); 
    _;
  }

  modifier checkDepositPaidAmount() {
    _;
    amountToRefund = msg.value - depositRequired;
    if (amountToRefund > 0) {
      (bool success, ) = tenant.call{value:amountToRefund}("");
      require(success, "Transfer failed.");
    }
  }

  constructor( address _landlord, address _tenant, address _adjudicator, uint _propertyId, uint _depositRequired) {
    require(_landlord != address(0), "Landlord address invalid");
    require(_tenant != address(0), "Tenant address invalid");
    require(_adjudicator != address(0), "Adjudicator address invalid");
    require(_depositRequired > 0, "Required deposit cannot be 0");

    landlord = _landlord;
    tenant = _tenant;
    adjudicator = _adjudicator;
    propertyId = _propertyId;
    depositRequired = _depositRequired;
    isAgreementActive = false;
  }

  receive() external payable paidCorrectDeposit tenantOnly {
    require(!isAgreementActive, "Agreement is active and deposit has already been paid by tenant");
    isAgreementActive = true;
    depositPaid = depositRequired;
    emit LogDepositPaid(msg.sender, depositPaid, propertyId, isAgreementActive);
  }

  function returnDeposit() public landlordOnly enoughDepositBalance nonReentrant {
    require(isAgreementActive, "Agreement is no longer active and deposit has already been returned to tenant");

    uint depositToReturn = depositPaid;
    depositPaid = 0;
    isAgreementActive = false;
    (bool success, ) = tenant.call{value:depositToReturn}("");
    require(success, "Deposit return failed.");
    emit LogDepositReturn(landlord, tenant, depositToReturn, propertyId, isAgreementActive);
  }

  function getDepositBalance() public view returns (uint) {
    return address(this).balance;
  }
}
